export default class TareasList extends Component {
  render() {
    return (
      <div style={{ "justify-content": "center" }}>
        <ul>
          {this.props.tareas.map(tarea => {
            return (
              <li>
                <div
                  style={{ display: "flex", cursor: pointer }}
                  onClick={() => console.log("hjfhfhfhfhfhfh")}
                >
                  <h4>{tarea.id}.</h4>
                  <h4> {tarea.name} </h4>
                </div>
                <p>{tarea.desc} </p>
              </li>
            );
          })}
        </ul>
      </div>
    );
  }
}
